function handleSvgClick(
  e: React.MouseEvent<SVGSVGElement>,
  onSelect: (part: SledPart) => void
) {
  const target = e.target as SVGElement | null;
  if (!target) return;

  const id = target.id as SledPart;

  if (CLICKABLE_PARTS.includes(id)) {
    onSelect(id);
  }
}

